import React from "react";

const DIsplayItem = ({ ticket }) => {
  return (
    <div>
      <p className="digit">{Math.floor(ticket % 1000000)}</p>
      <p className="digit">{Math.floor(ticket % 100000)}</p>
      <p className="digit">{Math.floor(ticket % 10000)}</p>
      <p className="digit">{Math.floor(ticket % 1000)}</p>
      <p className="digit">{Math.floor(ticket % 100)}</p>
      <p className="digit">{Math.floor(ticket % 10)}</p>
    </div>
  );
};
export default DIsplayItem;
